import { useSelector } from "react-redux";
import {
  Card,
  CardImg,
  CardImgOverlay,
  CardText,
  CardTitle,
  Button,
} from "reactstrap";
import "./PhotoList.scss";


function PhotoList() {
  const selector= useSelector((state)=>state.photos.payload)
  console.log(selector,"selectoer");
  return (
    <div className="photo-item">
      <Card className="photo-item__container">
        <CardImg
          className="photo-item__container__photo"
          alt="Card image cap"
          src="https://picsum.photos/318/270"
        />
        <CardImgOverlay className="photo-item__container__context">
          <CardTitle tag="h5">Card Title</CardTitle>
          <CardText>
            This is a wider card with supporting text below as a natural lead-in
            to additional content. This content is a little bit longer.
          </CardText>
          <CardText>
            <small className="text-muted">Last updated 3 mins ago</small>
          </CardText>
        </CardImgOverlay>
        <div className="photo-item__container__button">
          <Button color="info" outline >Edit</Button>
          <Button color="warning" outline>
            Remove
          </Button>
        </div>
      </Card>
    </div>
  );
}
export default PhotoList;
